import React from "react";

//Style Of Component
import "./modificationElement.scss"


const ModificationElement = ( { index, listComplete, setListComplete} ) => {

  const addElement= (ifr) => {
    console.log(ifr)
  }

	return( 
      <div className={"modification-element"} >  
        <label className="view-table-name"> { listComplete[index].name } </label>
        <input className="input name" type="text" label={listComplete[index].description} value={listComplete.description}  onChange={ (event) => setListComplete({ ...listComplete, description: event.target.value }) } /> 
        <label  className="view-table-status"> { listComplete[index].status } </label>
        <button className="button-work modification" onClick={ () => addElement(listComplete[index].id)} > OK </button>  
      </div> 
  )
}

export default React.memo(ModificationElement);
